import React from "react";
import "./Card.css";

function Card() {
  return (
    <div className="card" style={{ marginBottom: "10px" }}>
      <h5>Language Qualifications</h5>
      <p>
        HTML5, CSS, JavaScript, jQuery, Bootstrap, Express.js, React.js,
        Node.js, MongoDB, Mongoose, MySQL, Command Line, Git
      </p>
    </div>
  );
}

export default Card;
